import React, { useEffect } from "react";

const BDS = () => {
  useEffect(() => {
    // Tab functionality for the services section
    const tabBtns = document.querySelectorAll(".tab-btn");
    const tabContents = document.querySelectorAll(".tab-content");
    tabBtns.forEach((btn) => {
      btn.addEventListener("click", function () {
        const tabId = this.getAttribute("data-tab");
        tabBtns.forEach((btn) => btn.classList.remove("active", "text-primary", "border-primary"));
        tabContents.forEach((content) => content.classList.remove("active"));
        this.classList.add("active", "text-primary", "border-primary");
        document.getElementById(tabId).classList.add("active");
      });
    });
    return () => {
      tabBtns.forEach((btn) => {
        btn.replaceWith(btn.cloneNode(true));
      });
    };
  }, []);

  return (
    <div className="font-sans antialiased text-gray-800 bg-gray-50">
      {/* Navigation */}
      <nav className="bg-white shadow-md sticky top-0 z-50">
        <div className="container mx-auto px-6 py-4">
          <div className="flex justify-between items-center">
            <div className="flex items-center space-x-4">
              <div className="w-12 h-12 bg-primary rounded-full flex items-center justify-center text-white font-bold text-xl">BM</div>
              <span className="text-xl font-bold text-dark">Biruhminds</span>
            </div>
            <div className="hidden md:flex items-center space-x-8">
              <a href="#" className="text-primary font-medium">Services</a>
              <a href="#" className="text-gray-600 hover:text-primary transition">Resources</a>
              <a href="#" className="text-gray-600 hover:text-primary transition">Training</a>
              <a href="#" className="text-gray-600 hover:text-primary transition">About</a>
              <a href="#" className="bg-primary text-white px-6 py-2 rounded-full hover:bg-secondary transition">Contact</a>
            </div>
            <button className="md:hidden text-gray-600">
              <i className="fas fa-bars text-2xl"></i>
            </button>
          </div>
        </div>
      </nav>
      {/* Hero Section with Animated Background */}
      <section className="relative overflow-hidden bg-gradient-to-r from-primary to-secondary text-white py-24">
        <div className="absolute inset-0 opacity-10">
          <div className="absolute top-20 left-20 w-64 h-64 rounded-full bg-white opacity-20 mix-blend-overlay animate-float"></div>
          <div className="absolute bottom-20 right-20 w-64 h-64 rounded-full bg-white opacity-20 mix-blend-overlay animate-float" style={{ animationDelay: "2s" }}></div>
          <div className="absolute top-1/3 right-1/4 w-32 h-32 rounded-full bg-white opacity-20 mix-blend-overlay animate-float" style={{ animationDelay: "4s" }}></div>
        </div>
        <div className="container mx-auto px-6 text-center relative z-10">
          <h1 className="text-4xl md:text-6xl font-bold mb-6 leading-tight">Empower Your Business <br />Growth Journey</h1>
          <p className="text-xl md:text-2xl max-w-3xl mx-auto mb-8">
            Transformative business development services to scale your enterprise
          </p>
          <div className="flex flex-col sm:flex-row justify-center gap-4">
            <a href="#" className="bg-white text-primary px-8 py-4 rounded-full font-semibold hover:bg-gray-100 transition shadow-lg hover:shadow-xl">
              Explore Services <i className="fas fa-arrow-right ml-2"></i>
            </a>
            <a href="#" className="border-2 border-white text-white px-8 py-4 rounded-full font-semibold hover:bg-white hover:text-primary transition">
              <i className="fas fa-play mr-2"></i> Watch Demo
            </a>
          </div>
        </div>
      </section>
      {/* ...existing code... */}
      {/* The rest of the HTML content will be converted to JSX in the same way, preserving structure and classes. */}
    </div>
  );
};

export default BDS;
